import { motion } from 'framer-motion'

export default function Projects() {
    return (
        <motion.div 
            animate={{ rotate: 360 }} 
            transition={{ duration: 1 }}
            exit={{ opacity: 0 }} 
            id="projects-content" 
            className="content">
            PROJECTS
        </motion.div> 
    )
}
